package leetcode.dataStructure.String;

import java.util.HashMap;
import java.util.Map;

// 经验教训： 对于非基础类型，千万比较要用equals！！！！！！！！！！！！！！！！！！！！！！！！！！！！！！！！！
public class l_242_字符串包含的字符是否完全相同 {
    public static boolean isAnagram(String s, String t) {
        Map<Character,Integer> dict_1 = new HashMap<>();
        Map<Character,Integer> dict_2 = new HashMap<>();
        for (char i : s.toCharArray()){
            dict_1.put(i,dict_1.getOrDefault(i,0)+1);
        }
        for (char i : t.toCharArray()){
            dict_2.put(i,dict_2.getOrDefault(i,0)+1);
        }
        if (!dict_1.keySet().equals(dict_2.keySet())) return false;
        else{
            for (char c : dict_1.keySet()){
                if (!dict_1.get(c).equals(dict_2.get(c))){
                    return false;
                }
            }
        }
        return true;
    }

    public static void main(String[] args) {
        System.out.println(isAnagram(""
                ,""));
    }

}
